import React, { useEffect, useMemo, useState } from 'react';

import  ContentHeader  from '../../components/ContentHeader';
import GeneralArchiveInfo from '../../components/GeneralArchiveInfo';

import WarningBox from '../../components/WarningBox';
import main_cards_information from '../../repositories/main_cards_information';
import PieChartBox from '../../components/PieChartBox';
import HistoryBox from '../../components/HistoryBox';
import BarChartBox from '../../components/BarChartBox';

import { Container,
        Content } from './styles';



const Dashboard: React.FC = () => {

    const total_space = useMemo(() => {
        return String(main_cards_information.total_space) + " TB";
    
    },[]);

    const total_archived = useMemo(() => {
        return String(main_cards_information.total_archived) + " TB";
    
    },[]);

    const total_created = useMemo(() => {
        return String(main_cards_information.total_created) + " TB";
    
    },[]);

    const actual_date = useMemo(() => {
        const currentDate = new Date();
        const formattedDate = currentDate.toLocaleDateString('en-US', {
            year: 'numeric',
            month: '2-digit',
            day: '2-digit',
        });

        return "Updated on " + String(formattedDate);

    },[]);

    const relation_occupied_free = useMemo(() => {
        const spaceTotal = 100;
        const spaceOccupied = 85;
        const spaceFree = spaceTotal - spaceOccupied;
        
        const percentOccupied = ((spaceOccupied/spaceTotal) * 100);
        const percentFree = ((spaceFree/spaceTotal) * 100);

        const data = [
            {
                name: "Space Occupied",
                value: spaceOccupied,
                percent: Number(percentOccupied.toFixed(1)),
                color:'#E44C4E'
            },

            {
                name: "Space Free",
                value: spaceFree,
                percent: Number(percentFree.toFixed(1)),
                color:'#F7931B'
            },

        ]

        return data;
    
    },[]);


    const [dataTest, setData] = useState(null);
    const [loadingTest, setLoading] = useState(true);
    const [errorTest, setError] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
          try {

            console.log('test');
            // Replace 'your-api-endpoint' with the actual endpoint of your REST service
            const response = await fetch('http://localhost:8080/fixes/space/occupied/year/2011');
            console.log('response');
            if (!response.ok) {
              throw new Error('Failed to fetch data');
            }
    
            const result = await response.json();
            setData(result);
          } catch (error) {
            setError(error.message);
          } finally {
            setLoading(false);
          }
        };
    
        fetchData();
      }, [])

    const historyData = useMemo(() => {

        
        // Replace 'your-api-endpoint' with the actual endpoint of your REST service
        const response = fetch('http://localhost:8080/fixes/space/occupied/year/2011');
        
        console.log(response)
        const data =
        [{year: "2008", amountChanged:1.26},{ year: "2009", amountChanged:2.8},
         {year: "2010", amountChanged:5.03},{ year: "2011",amountChanged:7.56},
         {year: "2012", amountChanged:11.29},{ year: "2013", amountChanged:16.6},
         {year: "2014", amountChanged:24.2},{ year: "2015",amountChanged:33.36},
         {year: "2016", amountChanged:42.8},{ year: "2017", amountChanged:53.6},
         {year: "2018", amountChanged:65.8},{ year: "2019",amountChanged:85.3},
         {year: "2020", amountChanged:111.1},{ year: "2021", amountChanged:137.2},
         {year: "2022", amountChanged:166.7},{ year: "2023",amountChanged:202.3}]
         

        return data;
    
    },[]);


    const lowHighPublishFixes =useMemo(() => {
        return [
        {   
            name: "Low publish fixes",
            percent: 20,
            color:"#F7931B"
        },
        {   
            name: "High publish fixes",
            percent: 80,
            color:"#E44C4E"
        }
    ]
        
    
    },[]);

    const lowHighDemandFixes =useMemo(() => {
        return [
        {   
            name: "Low demand fixes",
            percent: 35,
            color:"#F7931B"
        },
        {   
            name: "High demand fixes",
            percent: 65,
            color:"#E44C4E"
        }
    ]
        
    
    },[]);



    
    
    return (
        <Container>
            <ContentHeader title ="Archive dashboard" linecolor='#F7931B'>
              
            </ContentHeader>
            <Content>
                <GeneralArchiveInfo title="Total space on server (in Terabytes):" 
                                    amount={total_space}
                                    footerlabel={actual_date}
                                    color ="#4E41F0"/>
                 <GeneralArchiveInfo title="Total archived this year (in Terabytes):" 
                                    amount= {total_archived}
                                    footerlabel={actual_date} 
                                    color ="#F7931B"/>
                 <GeneralArchiveInfo title="Total created this year(in Terabytes):" 
                                    amount= {total_created}
                                    footerlabel={actual_date}
                                    color ="#E44C4E"/>

                <HistoryBox
                    data = {historyData}
                    lineColorAmountChanged="#F7931B"/>
                    
                <WarningBox />
                <PieChartBox data={relation_occupied_free}/>
                

                <BarChartBox 
                        title="Low and high publish rates (%)"
                        data={lowHighPublishFixes} 
                              />
                <BarChartBox 
                        title="Low and high demand rates (%)"
                        data={lowHighDemandFixes} 
                />
                
            </Content>

        </Container>
    );
    }
export default Dashboard;
